import {Routes,Route,Link} from "react-router-dom"
import Home from "../Home"
import Products from "../Produts/Products"


function AllRoutes(){
    return(
        <Routes>
           <Route path="/" element={ <Home/>} />
           <Route path="/products" element={<Products />} />
        </Routes>
    )
}
export default AllRoutes
